                  "check_batch_number": {
                    "type": "string",
                    "description": "检验批次号"
                  },
                  "rejects_count": {
                    "type": "integer",
                    "description": "不良品数量",
                    "format": "int32"
                  }
                }
              },
              "encoding": {
                "check_code": {
                  "style": "form"
                },
                "checked_count": {
                  "style": "form"
                },
                "check_batch_number": {
                  "style": "form"
                },
